const Items = ({ items, setItems, ondelete }) => {
  return (
    <div>
      <input type="search" placeholder="search Item" />
      {items.map((item) => (
        <h3>
          {item.name}
          <button onClick={() => ondelete(item)}>Delete</button>
        </h3>
      ))}
    </div>
  );
};
export default Items;
